import React from 'react';
import Nav from '../Menu/Nav';
import styled from 'styled-components';

const Main = styled.div`
    body {
        overflow:hidden;
    }
`

function MainPageLayout({ children }) {
    return (
        <Main>
            <Nav />
            { children }
        </Main>
    )
};

export default MainPageLayout;
